import './ContactsDisplay.css'



export default function ContactsSelect(props) {

    return (
        <>
          <div className="members">
            <label>{props.username}</label>
            <input type="checkbox" ref={(ref) => { this.props.email = ref; }} value={props.email}/>
          </div>
        </>
        )
}
